Actionscript.script:
if(循环次数 < 3){
	gotoAndPlay("毁天灭地循环");
}

if(初始area高度){
	_parent.area._y = 初始area高度;
}else{
	_parent.area._y = -126.5;
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 5;
	子弹属性.最小霰弹值 = 5;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";

	自机 = _root.获得父节点(this,2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 1;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 35;
	子弹属性.击倒率 = 0.1;
	子弹属性.伤害类型 = "真伤";
	子弹属性.斩杀 = 13;

    子弹属性.水平击退速度 = 13
	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

