onClipEvent(load){
	this.onUnload = function(){
		_parent._parent.area._y = _parent.初始area高度;
	}
}
onClipEvent(enterFrame){
	_parent._parent.area._y = _parent.初始area高度 - 600;
   _parent.攻击时按键四向空中移动(0,15);
}

onClipEvent(load){
	this.onUnload = function(){
		_parent._parent.area._y = _parent.初始area高度;
	}
}
onClipEvent(enterFrame){
   _parent.攻击时按键四向空中移动(0,15);
	_parent._parent.area._y = _parent.初始area高度 - 600;
   	if (_parent._parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) )
	{
		_parent.gotoAndPlay("毁天灭地落地");
	}
}

onClipEvent(load){
   _parent.攻击时按键四向空中移动(0,15);
	_parent._parent.area._y = _parent.初始area高度 - 600;
   	if (_parent._parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) )
	{
		_parent.stop();
	}else{
		_parent.play();
	}
	this.onUnload = function(){
		_parent._parent.area._y = _parent.初始area高度;
	}
}
onClipEvent(enterFrame){
   _parent.攻击时按键四向空中移动(0,15);
	_parent._parent.area._y = _parent.初始area高度 - 600;
   	if (_parent._parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) )
	{
		_parent.stop();
	}else{
		_parent.play();
	}
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 and (_parent._parent.浮空 or (_parent._parent.技能浮空 == true)))
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
